    "",ntt"description": "The Neal Hot Springs geothermal system lies in a left-step
    in a north-striking, west-dipping normal fault system, consisting of the Neal Fault
    to the south and the Sugarloaf Butte Fault to the north (Edwards, 2013). The Neal
    Hot Springs 3D geologic model consists of 104 faults and 13 stratigraphic units.
    The stratigraphy is sub-horizontal to dipping <10 degrees and there is no predominant
    dip-direction. Geothermal production is exclusively from the Neal Fault south of,
    and within the step-over, while geothermal injection is into both the Neal Fault
    to the south of the step-over and faults within the step-over.",ntt"format":
